##Important information--------------------------------------------------------------------------------------------------
#Please note that in the OpenEO platform, the analysis was processed for each of the  data and temporality available and, 
#the results were exported to csv format. 
#At the time of executing these processes (May 2022), there was no option to assign a name to the resulting output file,
#so the platform named the results in the same way regardless of the data studied: "result.csv". Therefore, it was not 
#possible to automate this step and they had to be processed one by one, depending on the data studied.
#------------------------------------------------------------------------------------------------------------------------
#Code used to process the csv files downloaded from OpenEO platform
#Define the path to the folder where our csv files are located.
csvpath <- "C:\\Rprojects\\RStudio_EOdata_GitHub\\Open_EO_Platform_Editor\\OpenEO_platform_data&code" 
#Define the  name of the csv file to be processed
csvfile <- "\\result" 
#Create the full path of the csv file to be processed
csvname <- paste(csvpath, csvfile, ".csv", sep="")
#Load the file to the environment
result_csv <- read.csv(csvname)
str(result_csv)#We look at the structure of the data and see that the "data" column has to be separated in two diferent columns to be able to process the date properly.
#"2017-07-26T00:00:00.000Z" --> "2017-07-26" + "T00:00:00.000Z" 
library(tidyverse)
result_csv <- result_csv %>% separate(date,paste0("date",1:2),sep='T')
colnames(result_csv) <- c("date","time", "tile", "value")
result_tmax <- result_csv[,-c(2)] #Note that the second column has no useful information and is discarded.
save(result_tmax,
     file="OpenEO_platform_meteo_tmax.RData")
